import React, { Component, useState } from 'react';
import { Link } from 'react-router-dom';
import { Dropdown, DropdownToggle, DropdownMenu, DropdownItem } from 'reactstrap';


import PSPE_Logo from '../../images/PSPE_logo.png';
import './style.navbar.css';



const Navbar = () => {

    const [eventsOpen, setEventsOpen] = useState(false);
    const toggle = () => setEventsOpen(prevState => !prevState);



    return(
        <div className="navbar">
            <div className="logoContainer">
                <Link to="/"><img className="logoImage" src={PSPE_Logo}/></Link>
            </div>
            <div className="navlinkCollection">
                <Link className="navlink" to="/">Home</Link>
                <Link className="navlink" to="/about">About</Link>
                <Dropdown isOpen={eventsOpen} toggle={toggle}>
                    <DropdownToggle caret>
                        Events
                    </DropdownToggle>
                    <DropdownMenu>
                        <Link to="/events/research-roundtable"><DropdownItem>Research Roundtable</DropdownItem></Link>
                        <Link to="/events/research-roundtable"><DropdownItem>Other Event</DropdownItem></Link>
                    </DropdownMenu>
                </Dropdown>
                <Link className="navlink" to="/news">News</Link>
                <Link className="navlink" to="/contact">Contact</Link>
                <Link className="navlink" to="/sponsors">Sponsors</Link>
            </div>


        </div>
    );

}

export default Navbar;
